import { BrowserRouter, Route, Routes } from "react-router-dom";

import Home from './pages/Home/Index';

const Router = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={ <Home /> }/>
            </Routes>
        </BrowserRouter>
    )
}

export default Router;
